const CardDaftarMenu = ({gambar, harga, kode, nama, aktif}) => {

	console.log(aktif)

	return(
		<div>
			<img src={"asset/" + aktif.toLowerCase() + "/" + gambar}/>
			<h2>{nama}<span>{kode}</span></h2>
			<h2>{harga}</h2>
		</div>
	)
}

export default CardDaftarMenu;
